//import './Navbar.css';
import React from 'react'
import { NavLink } from 'react-router-dom'

function Navbar() {
  return (
    <div>
    <h1>hiiii</h1>
    <nav>
        <NavLink to='/'>Home</NavLink>
        <NavLink to='/products/:id'>Product</NavLink>
    </nav>
    </div>
  )
}

export default Navbar
